<span class="line"><span style="color:#E1E4E8;">    linear_logits </span><span style="color:#F97583;">=</span><span style="color:#E1E4E8;"> get_linear_logits(dense_input_dict, sparse_input_dict, linear_feature_columns)</span></span>
